Maybe more will come when they realize we have cute lolis.

This has certainty been an interesting experience so far.
Things we have learned thus far:
-99% of the people here have no idea how ZeroNet/Millchan works;
-Some people unironically come to a decentralized service expecting and/or demanding it to behave exactly as a centralized service;
-Some people cannot fathom the concept of self-moderation;
-Some people have a volatile threshold for what they consider to be "free speech";
-Most people have no clue about what "Mill" stands for;
-Online personas often lead to virtue signalling;
-Post editing is the best feature ==<3==
